import Link from 'next/link';

const linkStyle = {
    marginRight: 15,
    background: 'red'
  };
 
const navStyle = {
    alignContent:  center
};

  const Navbar = () => (
    <div style = {navStyle}>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </div>
    
  );
  
  export default Navbar;
